def big_primefac_div(n):
    if isinstance(n, float) and n % 1 != 0:
        return "The number has a decimal part. No Results"

    n = abs(int(n))

    if n < 2:
        return []

    highest_prime = None
    highest_divisor = None

    def prime_factors(n):
        factors = []
        for i in range(2, int(n**0.5) + 1):
            while n % i == 0:
                factors.append(i)
                n //= i
        if n > 1:
            factors.append(n)
        return factors

    factors = prime_factors(n)

    if not factors:
        return []

    highest_prime = max(factors)
    factors_count = {factor: factors.count(factor) for factor in set(factors)}

    if highest_prime == n:
        return []

    highest_divisor = n
    for factor in factors_count:
        divisor = n // factor
        if divisor < n and (highest_divisor is None or divisor > highest_divisor):
            highest_divisor = divisor

    return [highest_prime, highest_divisor]
