def big_primefac_div(n):
    if isinstance(n, float) and n % 1 != 0:
        return "The number has a decimal part. No Results"

    n = abs(int(n))
    highest_prime = 0
    highest_divisor = 0

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    for i in range(2, n + 1):
        while n % i == 0:
            highest_prime = i
            n //= i

    if highest_prime == 0 or is_prime(highest_prime):
        return []

    highest_divisor = highest_prime * (highest_prime if highest_prime != 1 else 0)

    while highest_divisor >= 2:
        if highest_divisor != highest_prime and highest_divisor < highest_prime * 2:
            break
        highest_divisor -= 1

    return [highest_prime, highest_divisor]
